export interface JDSBottomNavigationProps {
    /**  */
    multiLine?: boolean;
    /** It shows list of items. */
    items?: Array<{
        navAriaLabel?: string;
        navAriaDescribedby?: string;
        icon?: string | JSX.Element;
        label?: string;
        disabled?: boolean;
    }>;
    /** It can be used to change the current active index. */
    activeIndex?: number;
    /** Shows label below icon if true,by default it is false. */
    showLabel?: boolean;
    onChange?: () => void;
    custom?: string;
}
